import React from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  LineElement,
  PointElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Bar, Line } from 'react-chartjs-2';
import { TrendingUp, TrendingDown } from 'lucide-react';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  LineElement,
  PointElement,
  Title,
  Tooltip,
  Legend
);

const KPISection = () => {
  const kpiData = [
    {
      title: 'Average Commute Time',
      baseline: 28.5,
      aiControlled: 24.2,
      unit: 'min',
      target: 10,
      improvement: 15.1
    },
    {
      title: 'Queue Length',
      baseline: 45,
      aiControlled: 32,
      unit: 'vehicles',
      target: 15,
      improvement: 28.9
    },
    {
      title: 'Throughput',
      baseline: 1200,
      aiControlled: 1450,
      unit: 'veh/h',
      target: 20,
      improvement: 20.8
    },
    {
      title: 'Waiting Time',
      baseline: 65,
      aiControlled: 42,
      unit: 'sec',
      target: 25,
      improvement: 35.4
    },
    {
      title: 'CO₂ Emissions',
      baseline: 850,
      aiControlled: 720,
      unit: 'kg/h',
      target: 12,
      improvement: 15.3
    }
  ];

  const chartOptions = {
    responsive: true,
    maintainAspectRatio: false,
    plugins: {
      legend: {
        position: 'top',
        labels: {
          font: {
            size: 11
          },
          color: '#475569'
        }
      },
      tooltip: {
        titleFont: {
          size: 12
        },
        bodyFont: {
          size: 11
        }
      }
    },
    scales: {
      y: {
        beginAtZero: true,
        ticks: {
          font: {
            size: 10
          },
          color: '#64748b'
        },
        grid: {
          color: '#e2e8f0'
        }
      },
      x: {
        ticks: {
          font: {
            size: 10
          },
          color: '#64748b'
        },
        grid: {
          color: '#e2e8f0'
        }
      }
    }
  };

  const barChartData = {
    labels: kpiData.map(item => item.title),
    datasets: [
      {
        label: 'Baseline',
        data: kpiData.map(item => item.baseline),
        backgroundColor: '#94a3b8',
        borderWidth: 0,
      },
      {
        label: 'AI-Controlled',
        data: kpiData.map(item => item.aiControlled),
        backgroundColor: '#22c55e',
        borderWidth: 0,
      }
    ]
  };

  const lineChartData = {
    labels: ['00:00', '04:00', '08:00', '12:00', '16:00', '20:00', '24:00'],
    datasets: [
      {
        label: 'Baseline Performance',
        data: [75, 78, 65, 55, 62, 70, 73],
        borderColor: '#94a3b8',
        backgroundColor: 'transparent',
        borderWidth: 2,
        pointRadius: 3,
        pointBackgroundColor: '#94a3b8'
      },
      {
        label: 'AI Performance',
        data: [85, 88, 82, 78, 85, 87, 86],
        borderColor: '#22c55e',
        backgroundColor: 'transparent',
        borderWidth: 2,
        pointRadius: 3,
        pointBackgroundColor: '#22c55e'
      }
    ]
  };

  const getImprovementIcon = (improvement, target) => {
    if (improvement >= target) return <TrendingUp className="w-4 h-4 text-success-500" />;
    if (improvement > 0) return <TrendingUp className="w-4 h-4 text-warning-500" />;
    return <TrendingDown className="w-4 h-4 text-danger-500" />;
  };

  return (
    <div className="glass-card cyber-border" style={{ background: 'rgba(39, 39, 42, 0.1)', color: 'white' }}>
      <div style={{ borderBottom: '1px solid rgba(0, 255, 255, 0.2)', padding: '16px 24px', background: 'rgba(0, 255, 255, 0.05)' }}>
        <h2 style={{ fontSize: '20px', fontWeight: '600', color: 'white', margin: '0 0 4px 0' }}>Performance KPIs</h2>
        <p style={{ fontSize: '14px', color: 'rgba(0, 255, 255, 0.7)', margin: '0' }}>Baseline vs AI-Controlled Comparison</p>
      </div>
      
      <div className="p-4">
        {/* KPI Cards */}
        <div className="grid grid-cols-1 md:grid-cols-3 lg:grid-cols-5 gap-4 mb-6">
          {kpiData.map((kpi, index) => (
            <div key={index} className="border border-primary-200 p-3 bg-primary-50">
              <div style={{
                fontSize: '12px',
                fontWeight: '500',
                color: '#00ffff',
                marginBottom: '4px',
                fontFamily: 'JetBrains Mono, monospace'
              }}>{kpi.title}</div>
              <div className="flex items-center justify-between mb-2">
                <div style={{
                  fontSize: '18px',
                  fontWeight: 'bold',
                  color: '#ffffff',
                  fontFamily: 'JetBrains Mono, monospace'
                }}>
                  {kpi.aiControlled}{kpi.unit}
                </div>
                <div className="flex items-center space-x-1">
                  {getImprovementIcon(kpi.improvement, kpi.target)}
                  <span className={`text-xs font-medium ${
                    kpi.improvement >= kpi.target ? 'text-success-600' : 
                    kpi.improvement > 0 ? 'text-warning-600' : 'text-danger-600'
                  }`}>
                    {kpi.improvement > 0 ? '+' : ''}{kpi.improvement}%
                  </span>
                </div>
              </div>
              <div style={{
                fontSize: '12px',
                color: '#8cc8ff',
                fontFamily: 'JetBrains Mono, monospace'
              }}>
                Baseline: {kpi.baseline}{kpi.unit}
              </div>
              <div style={{
                fontSize: '12px',
                color: '#8cc8ff',
                fontFamily: 'JetBrains Mono, monospace'
              }}>
                Target: ≥{kpi.target}% improvement
              </div>
            </div>
          ))}
        </div>

        {/* Charts */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
          {/* Bar Chart */}
          <div className="border border-primary-200 p-4">
            <h3 style={{
              fontSize: '14px',
              fontWeight: '600',
              color: '#00ffff',
              marginBottom: '12px',
              fontFamily: 'JetBrains Mono, monospace',
              textShadow: '0 0 10px rgba(0, 255, 255, 0.5)'
            }}>Current Performance Comparison</h3>
            <div style={{ height: '250px' }}>
              <Bar data={barChartData} options={chartOptions} />
            </div>
          </div>

          {/* Line Chart */}
          <div className="border border-primary-200 p-4">
            <h3 style={{
              fontSize: '14px',
              fontWeight: '600',
              color: '#00ffff',
              marginBottom: '12px',
              fontFamily: 'JetBrains Mono, monospace',
              textShadow: '0 0 10px rgba(0, 255, 255, 0.5)'
            }}>24-Hour Performance Trend</h3>
            <div style={{ height: '250px' }}>
              <Line data={lineChartData} options={chartOptions} />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default KPISection;
